import styled from 'styled-components';

export const Container = styled.div`
  width: 95%;
  max-width: 960px;
  margin: auto;

  .heroFrase {
    width: 90%;
    max-width: 680px;
    display: block;
    position: relative;
    margin: 80px auto 1%;
    left: 3%;
    right: 3%;
  }

  .heroBanner {
    width: 100%;
    max-width: 960;
    display: block;
    margin: 0 auto 8%;
  }
`;
